      r(3)=a(3) 
      r(4)=b(1) 
      r(5)=b(2) 
      r(6)=b(3) 
      r(7)=c(1) 
      r(8)=c(2) 
      r(9)=c(3) 
      r(10)=d(1)
      r(11)=d(2)
      r(12)=d(3)
		              
	call vh3o_12(a,b,c,d,vuser)                
                
      ! print*,vuser                        
      passo=1.0d-5*5.2917721092d-11         
                
      Do 200 iq=1,12,1                      
			             
         DO 220 I=1,12,1                    
                
             rr(i)=r(i)                     
	               
  220    continue                           
          ider=iq                           
