      FUNCTION dfridq(func,x,h,err)         
      REAL*8 dfridq,err,h,x,func,CON,CON2,BIG,SAFE                      
      INTEGER NTAB                          
      PARAMETER (CON=1.4d0,CON2=CON*CON,BIG=1.d30,NTAB=10,SAFE=2.d0)    
      EXTERNAL func                         
                
      INTEGER i,j                           
      REAL*8 errt,fac,hh,a(NTAB,NTAB)       
                
      if(h.eq.0.d0) stop 'h must be nonzero in dfridq'                  
      hh=h      
      a(1,1)=(func(x+hh)-func(x-hh))/(2.0d0*hh)                         
      err=BIG   
      do 12 i=2,NTAB                        
        hh=hh/CON                           
        a(1,i)=(func(x+hh)-func(x-hh))/(2.0d0*hh)                       
        fac=CON2
        do 11 j=2,i                         
          a(j,i)=(a(j-1,i)*fac-a(j-1,i-1))/(fac-1.d0)                   
          fac=CON2*fac                      
          errt=max(abs(a(j,i)-a(j-1,i)),abs(a(j,i)-a(j-1,i-1)))         
          if (errt.le.err) then	            
            err=errt                        
            dfridq=a(j,i)                   
          endif 
11      continue
        if(abs(a(i,i)-a(i-1,i-1)).ge.SAFE*err)return                    
12    continue  
                
      END       
                
                
                
! This is the potential energy surface for H+H2O reaction, combine spline fit to  high quality ab in
! simple empirical functions for the spectator variables.               
!  (atomic units used)                      
!               
!               
!      H2c      
!       \       
!        Ob---H1d-----H3a                   
!               
!               
!    Ab initio method: CAS+1+2/aug-pvdz     
!               
!               
!    roh =   r(O-H1)        (au)          1.4 &lt; roh   &lt; 4.0,  14 points                       
!    rhh =   r(H1-H3)       (au)          1.3 &lt; rhh   &lt; 8.0,  18 points                       
!    theta = O-H1-H3 angle  (degrees)     80  &lt; theta &lt; 280,  21 points                       
!               
!               
!               
!               
!  Reference:  J. Chem. Phys. 113(8), xxxx, 2000 (Aug. 22)              
!  by  G.S. Wu, G. Lendvay, G.C. Schatz, D.C. Fang &amp; L. Harding     
!               
!  Comments to: schatz@chem.nwu.edu         
!               
!               
!sample input data                          
!------------------------------             
!<H2O.D>        
!               
!               
! 7.50      0.      0.                      
! 0.00      0.      0.                      
!-0.45      1.75    0.                      
! 1.81      0.      0.                      
! vpot=   2.2541692740290602E-03            
!               
!               
!               
!------------------------------             
!<H2+OH.D>      
!               
!               
! 8.00      0.       0.                     
! 0.        0.       0.                     
!-0.       -1.85     0.                     
! 6.60      0.       0.                     
! vpot=   2.5657103192452003E-02            
!               
!               
!------------------------------             
!<SP.D>         
!               
!               
! 4.15       -0.15        0.                
! 0.00        0.00        0.                
!-0.15       -1.84        0.                
! 2.57        0.00        0.                
! vpot=   3.4844257349740913E-02            
!               
!               
!------------------------------c--------------------------------------------------------------------
! This is the potential used for H+H2O reaction (atomic units used).    
!               
! Reference:  J. Chem. Phys. 113(8), xxxx, 2000 (Aug. 22)               
! by  G.S. Wu, G.C. Schatz, G. Lendvay, D.C. Fang &amp; L. Harding      
! Comments to: schatz@chem.nwu.edu          
!---------------------------------------------------------------------  
!   a=H3, b=O, c=H2, d=H1                   
!      H2c      
!       \       
!        Ob---H1d-----H3a                   
! for Ha + Hc-O-Hd --&gt; HaHd + HcOb  ( with O-Hd EXCITED)             
! input cartesian coordinates of a, b, c and d, get the potential.      
!               
!               
                
                
       subroutine vh3o_12(ain,bin,cin,din,vpot)                         
       
       implicit double precision (a-h,o-z)  
       dimension a(3),b(3),c(3),d(3)        
       dimension ain(3),bin(3),cin(3),din(3)
                
        con=4.3597482D-18        
                
                
                
       a=ain/5.2917721092d-11               
       b=bin/5.2917721092d-11               
       c=cin/5.2917721092d-11               
       d=din/5.2917721092d-11               
                
                
! get inter-atomic distances and cosine value of the dihedral angle.    
                
                
      call coortrans_12(a,b,c,d,rab,rac,rad,rbc,rbd,rcd,cosdi)         
!	pri t*,a &    
!	pri t*,b &    
!	pri t*,c &    
!	pri t*,d &    
!	pri t*,rab &  
!	pri t*,rac &  
!	pri t*,rad &  
!	pri t*,rbc &  
!	pri t*,rbd &  
!	pri t*,rcd    
                
                
!               
! If you are only interested in the properties of one reaction channel, 
! comment the switching part of Hc and Hd,  and this will save much time.                           
!               
! Decide whether Hd or Hc is reactive       
      dif = (rac - rad)                     
      switch = 0.5d0*(1.d0-tanh(3.0d0*dif))       
! If Hd is the reactive atom.               
      call newpes_12(rab,rac,rad,rbc,rbd,rcd,vpot,cosdi)                
! Or if Hc is the reactive atom, then exchange c &amp; d                
      call coortrans_12(a,b,d,c,rab,rad,rac,rbd,rbc,rcd,cosdi)          
      call newpes_12(rab,rad,rac,rbd,rbc,rcd,vpot2,cosdi)               
!               
      vpot = vpot*(1.0d0-switch) + vpot2*switch                           
!      write(6,*) 'vpot= ', vpot            
                
!      print*,'vpot func eV',vpot           
                
                
                
                
                
      vpot=vpot-0.3704d0                    

!      print*,'vpot vh3o',vpot          
!      print*,ain,bin,cin,din



      vpot=vpot*4.3597482D-18               





      return    
      end       
                
                
       subroutine vh3oint_12(r,vpot)        
       implicit double precision (a-h,o-z)  
       dimension r(6)                       
                
       rab=r(1) 
                
! Decide whether Hd or Hc is reactive       
      dif = (rac - rad)                     
      switch = 0.5*(1.-tanh(3.0*dif))       
! If Hd is the reactive atom.               
      call newpes_12(rab,rac,rad,rbc,rbd,rcd,vpot,cosdi)                
! Or if Hc is the reactive atom, then exchange c &amp; d                
!      call coortrans_12(a,b,d,c,rab,rad,rac,rbd,rbc,rcd,cosdi)         
      call newpes_12(rab,rad,rac,rbd,rbc,rcd,vpot2,cosdi)               
!               
      vpot = vpot*(1.0-switch) + vpot2*switch                           
!      write(6,*) 'vpot= ', vpot            
      return    
      end       
                
                
      subroutine newpes_12(rab,rac,rad,rbc,rbd,rcd,vpot,cosdi)          
! For the potential of reactants or products, can set cosdi=1.0 ot -1.0,
!   and some r's be very large values.      
       implicit double precision (a-h,o-z)  
         
!      H2c      
!       \       
!        Ob---H1d-----H3a                   
! theta=O-H1-H3 , th=H2-O-H1                
      arg=((rbd**2+rad**2-rab**2)/(2.0*rbd*rad))                        
      if(arg .lt. -1.0) arg=-1.0            
      if(arg .gt.  1.0) arg= 1.0            
      theta=acos(arg)*180./3.1415926536     
! harding1_12 includes the switching of theta out of the 80~280(degree) range.                      
! here theta is always in 0~ 180 range by the defination of acos function                           
      cosd=abs(cosdi)                       
      call harding1_12(rbd,rad,theta,cosd,v3)                           
      call harding1_12(rbd,rad,theta,-cosd,v3p)                         
! including tortional part here             
      cc1=(v3+v3p)/2.0                      
      cc2=(v3-v3p)/2.0                      
      v3=cc1+cc2*cosdi                      
! Morse function for OHc spectator.         
      voh= 0.1628*(1.-exp(-1.22*(rbc-1.85)))**2                         
! add this part to fix the th0 problem      
! switching th0 from 95(saddle point) to 105(H2O in equilibrium)        
      th0=89.31+15.69*exp(-1.43*(rbd-1.81)) 
      costh=(rbc**2+rbd**2-rcd**2)/(2.0*rbc*rbd)                        
      x=costh-cos(th0/180.*3.1415926536)    
! H2OH1 bending part,  switching the force constant                     
      vbend=0.5*0.185*exp(-0.82*(rbd-1.81))*x*x &                       
               +0.015*exp(-0.82*(rbd-1.81))*x*x*x                       
!       vbend=0.5*0.185*x*x+0.015*x*x*x     
! parameters 0.185 &amp; 0.015 make the bending frequency at the TS     
! close to that of the ab initio values.    
      vpot=v3+voh+vbend                     
! switching between the spline fit and the asymptotic double Morse      
! for H2+OH product region.                 
      s=0.5*(1.-tanh(3.0*(rbd-4.0)))        
      va=0.1698*(1.0-exp(-1.21*(rbc-1.85)))**2 &                        
        +0.1745*(1.0-exp(-1.03*(rad-1.40)))**2+0.0256571                
      vpot=vpot*s+ va*(1.0-s)               
! switching between the spline fit and the PJT2 potential               
!  for the H2O+H reactant region.           
      s=0.5*(1.-tanh( 4.0*(rad-6.0)))       
      call surfh2o_12(rbc,rcd,rbd,vpjt2)    
      vpot=vpot*s+ vpjt2*(1.0-s)            
      return    
      end       
                
                
      subroutine harding1_12(rbd,rad,thet,cosdi,v3)                     
      implicit double precision (a-h,o-z)   
      theta=thet
      if(cosdi.lt.0) theta=360. - theta     
! Here, switch the angle to the range of 80~280(spline fit)             
      if((theta.lt.80.0).or.(theta.gt.280.0)) then  
        help=80.
        help2=280.                          
        call harding_12(rbd,rad,help,v1)    
        call harding_12(rbd,rad,help2,v2)   
        thet1=360.0-theta                   
!               
        if (theta .lt. 80.0 ) then          
          call harding_12(rbd,rad,theta,v5) 
          if(v5.lt.v1) v5=v1                
          call harding_12(rbd,rad,thet1,v4) 
          if(v4.lt.v2) v4=v2                
        else    
! here theta&gt;280, and thet1&lt;80.       
          call harding_12(rbd,rad,thet1,v5) 
          if(v5.lt.v1) v5=v1                
          call harding_12(rbd,rad,theta,v4) 
          if(v4.lt.v2) v4=v2                
        endif   
        s1=0.5*(1.-tanh(theta/10.))         
        s2=0.5*(1.-tanh(thet1/10.))         
        if(theta .lt. 80.) v3=v4*s1 + v5*(1.-s1)                        
        if(theta .gt.280.) v3=v4*(1.-s2)+ v5*s2                         
      else      
        call harding_12(rbd,rad,theta,v3)   
      endif     
      end       
! spline part of H+H2O surface              
      subroutine harding_12(xi,yi,zi,fi)    
!     sample main for calling h+h2o 3d spline                           
!               
!      Hb       
!       \       
!        O---Ha---Hc                        
!               
!               
!               
!     input:    
!              roh =   r(O-Ha)        (au)          1.4 &lt; roh   &lt; 4.0                         
!              rhh =   r(Ha-Hc)       (au)          1.3 &lt; rhh   &lt; 8.0                         
!              theta = Hc-Ha-O angle  (degrees)     80  &lt; theta &lt; 280                         
!               
!                Note: theta &lt; 180 =&gt; cis     (Hb-O-Ha-Hc =   0.0)
!                      theta &gt; 180 =&gt; trans   (Hb-O-Ha-Hc = 180.0)
!               
