   50 TEMP1(I,J)=DDOT_12(4,C(1,I,J),1,PZ,1) 
      DO 60 I=1,4                           
   60 TEMP2(I)=DDOT_12(4,TEMP1(1,I),1,PY,1) 
      FI=DDOT_12(4,TEMP2,1,PX,1)            
!               
      RETURN    
      END       
      DOUBLE PRECISION FUNCTION DDOT_12(N,DX,INCX,DY,INCY)              
!               
!     FORMS THE DOT PRODUCT OF TWO VECTORS. 
!     USES UNROLLED LOOPS FOR INCREMENTS EQUAL TO ONE.                  
!     JACK DONGARRA, LINPACK, 3/11/78.      
!               
      DOUBLE PRECISION DX(1),DY(1),DTEMP    
      INTEGER I,INCX,INCY,IX,IY,M,MP1,N     
!               
      DDOT_12 = 0.0D0                       
      DTEMP = 0.0D0                         
      IF(N.LE.0)RETURN                      
      IF(INCX.EQ.1.AND.INCY.EQ.1)GO TO 20   
!               
!        CODE FOR UNEQUAL INCREMENTS OR EQUAL INCREMENTS                
!          NOT EQUAL TO 1                   
!               
      IX = 1    
      IY = 1    
      IF(INCX.LT.0)IX = (-N+1)*INCX + 1     
      IF(INCY.LT.0)IY = (-N+1)*INCY + 1     
      DO 10 I = 1,N                         
        DTEMP = DTEMP + DX(IX)*DY(IY)       
        IX = IX + INCX                      
        IY = IY + INCY                      
   10 CONTINUE  
      DDOT_12 = DTEMP                       
      RETURN    
!               
!        CODE FOR BOTH INCREMENTS EQUAL TO 1
!               
!               
!        CLEAN-UP LOOP                      
!               
   20 M = MOD(N,5)                          
      IF( M .EQ. 0 ) GO TO 40               
      DO 30 I = 1,M                         
        DTEMP = DTEMP + DX(I)*DY(I)         
   30 CONTINUE  
      IF( N .LT. 5 ) GO TO 60               
   40 MP1 = M + 1                           
      DO 50 I = MP1,N,5                     
        DTEMP = DTEMP + DX(I)*DY(I) + DX(I + 1)*DY(I + 1) + &           
         DX(I + 2)*DY(I + 2) + DX(I + 3)*DY(I + 3) + DX(I + 4)*DY(I + 4)
   50 CONTINUE  
   60 DDOT_12 = DTEMP                       
      RETURN    
      END       
      subroutine hunt_12(xx,n,x,jlo)        
      implicit real*8 (a-h,o-z)             
      dimension xx(n)                       
      logical ascnd                         
                
                
      ascnd = xx(n) .gt. xx(1)              
      if( jlo .le. 0  .or. jlo .gt. n) then 
         jlo = 0
         jhi=n+1
         go to 3
      endif     
      inc=1     
                
                
      if( x.ge. xx(jlo) .eqv. ascnd) then   
 1       jhi = jlo+inc                      
         if(jhi .gt. n) then                
           jhi=n+1                          
         else if( x .ge. xx(jhi) .eqv. ascnd) then                      
           jlo=jhi                          
           inc=inc+inc                      
           go to 1                          
         endif  
      else      
         jhi=jlo
 2       jlo=jhi-inc                        
         if(jlo .lt.1) then                 
            jlo=0                           
         else if( x .lt. xx(jlo) .eqv. ascnd) then                      
            jhi=jlo                         
            inc=inc+inc                     
            go to 2                         
         endif  
      endif     
                
                
 3    if(jhi -jlo .eq.1) return             
      jm=(jhi+jlo)/2                        
      if( x .gt. xx(jm) .eqv. ascnd) then   
         jlo = jm                           
      else      
         jhi = jm                           
      endif     
      go to 3   
      end       
! PJT2 for H2O  
!     subroutine surfh2o_12(rbc,rcd,rbd,pot)
       subroutine surfh2o_12(r1,r4,r2,pot)  
       implicit real*8(a-h,o-z)             
! bond angle using cosine theorem           
      ctheta=(r1*r1 + r2*r2 - r4*r4)/(2.*r1*r2)                         
      sig=1.    
      if(ctheta .lt. 0.) then               
      ctheta=-ctheta                        
      sig=-1.   
      endif     
      ctheta=sig*ctheta                     
      theta=acos(ctheta)                    
! If the atoms are labelled O, H1,H2,    then the following are         
! the internuclear distances:               
! OH1=r1        
! OH2=r2        
! H1H2=r4       
      call POTS_12(pot,r1,r2,theta)         
      return    
      end       
                
                
                
      SUBROUTINE POTS_12(V,Q1,Q2,THETA)     
!     Potential PJT2 due Polyansky, Jensen and Tennyson,                
!     J. Chem. Phys., 105, 6490-6497 (1996) 
!     Update of Polyansky, Jensen and Tennyson, J Chem Phys 101, 7651 (1994))                       
!     Units: Hartree and Bohr               
      IMPLICIT DOUBLE PRECISION (A-H,O-Z)   
!     RZ = OH equilibrium value             
!     RHO = equilibrium value of pi - bond angle(THETA)                 
      DATA TOANG/0.5291772/, CMTOAU/219474.624/                         
      DATA X1/1.0/                          
      DATA RHO1    /    75.50035308/        
!      DATA FA1     /     .00000000/         
      DATA FA2     /18902.44193433/         
      DATA FA3     /  1893.99788146/        
      DATA FA4     /  4096.73443772/        
      DATA FA5     /-1959.60113289/         
      DATA FA6     /  4484.15893388/        
      DATA FA7     /  4044.55388819/        
      DATA FA8     / -4771.45043545/        
      DATA FA9     /     0.00000000/        
      DATA FA10    /     0.00000000/        
      DATA rZ    /     .95792059/           
      DATA A     /    2.22600000/           
      DATA F1A1    /  -6152.40141181/       
      DATA F2A1    / -2902.13912267/        
      DATA F3A1    / -5732.68460689/        
      DATA F4A1    /  953.88760833/         
      DATA F11     / 42909.88869093/        
      DATA F1A11   /  -2767.19197173/       
      DATA F2A11   /  -3394.24705517/       
!      DATA F3A11   /     .00000000/         
      DATA F13     /  -1031.93055205/       
      DATA F1A13   /  6023.83435258/        
!      DATA F2A13   /     .00000000/         
!      DATA F3A13   /     .00000000/         
      DATA F111    /     .00000000/         
      DATA F1A111  /   124.23529382/        
      DATA F2A111  /  -1282.50661226/       
      DATA F113    /  -1146.49109522/       
      DATA F1A113  /  9884.41685141/        
      DATA F2A113  /  3040.34021836/        
      DATA F1111   /  2040.96745268/        
      DATA FA1111  /  .00000000/            
      DATA F1113   /  -422.03394198/        
      DATA FA1113  /-7238.09979404/         
!      DATA F1133   /     .00000000/         
      DATA FA1133  /     .00000000/         
      DATA F11111  / -4969.24544932/        
      DATA f111111/  8108.49652354/         
      DATA F71   /  90.00000000/            
                
                
      data c1/50.0/,c2/10.0/,beta1/22.0/,beta2/13.5/,gammas/0.05/, &    
           gammaa/0.10/,delta/0.85/,rhh0/1.40/                          
                 RHO=RHO1*3.141592654/180.000000000                     
                 RHO=RHO1*3.141592654/180.000000000                     
      fa11=0.0  
      f1a3=f1a1 
      f2a3=f2a1 
      f3a3=f3a1 
      f4a3=f4a1 
      f33=f11   
      f1a33=f1a11                           
      f2a33=f2a11                           
      f333=f111 
      f1a333=f1a111                         
      f2a333=f2a111                         
      f133=f113 
      f1a133=f1a113                         
      f2a133=f2a113                         
      f3333=f1111                           
      fa3333=fa1111                         
      f1333=f1113                           
      fa1333=fa1113                         
      f33333=f11111                         
      f333333 =f111111                      
      f73     =f71                          
                
                
!     Find value for DR and DS              
      DR = TOANG*Q1 - RZ                    
      DS = TOANG*Q2 - RZ                    
                
                
!     Transform to Morse coordinates        
      Y1 = X1 - EXP(-A * DR)                
      Y3 = X1 - EXP(-A * DS)                
                
                
!     transform to Jensens angular coordinate                           
      CORO = DCOS(THETA) + DCOS(RHO)        
!      write(7,*) CORO                      
!     Now for the potential                 
      V0=(FA2+FA3*CORO+FA4*CORO**2+FA6*CORO**4+FA7*CORO**5)*CORO**2     
      V0=V0+(FA8*CORO**6+FA5*CORO**3+FA9*CORO**7+FA10*CORO**8 )*CORO**2 
      V0=V0+(        FA11*CORO**9 )*CORO**2 
      FE1= F1A1*CORO+F2A1*CORO**2+F3A1*CORO**3+F4A1*CORO**4             
      FE3= F1A3*CORO+F2A3*CORO**2+F3A3*CORO**3+F4A3*CORO**4             
      FE11= F11+F1A11*CORO+F2A11*CORO**2    
      FE33= F33+F1A33*CORO+F2A33*CORO**2    
      FE13= F13+F1A13*CORO                  
      FE111= F111+F1A111*CORO+F2A111*CORO**2
      FE333= F333+F1A333*CORO+F2A333*CORO**2
      FE113= F113+F1A113*CORO+F2A113*CORO**2
      FE133= F133+F1A133*CORO+F2A133*CORO**2
      FE1111= F1111+FA1111*CORO             
      FE3333= F3333+FA3333*CORO             
      FE1113= F1113+FA1113*CORO             
      FE1333= F1333+FA1333*CORO             
      FE1133=       FA1133*CORO             
      FE11111=F11111                        
      FE33333=F33333                        
      FE111111=F111111                      
      FE333333=F333333                      
      FE71    =F71                          
      FE73    =F73                          
      V   = V0 +  FE1*Y1+FE3*Y3 &           
               +FE11*Y1**2+FE33*Y3**2+FE13*Y1*Y3 &                      
               +FE111*Y1**3+FE333*Y3**3+FE113*Y1**2*Y3 &                
               +FE133*Y1*Y3**2 &            
               +FE1111*Y1**4+FE3333*Y3**4+FE1113*Y1**3*Y3 &             
               +FE1333*Y1*Y3**3+FE1133*Y1**2*Y3**2 &                    
               +FE11111*Y1**5+FE33333*Y3**5 &                           
               +FE111111*Y1**6+FE333333*Y3**6 &                         
               +FE71    *Y1**7+FE73    *Y3**7                           
      go to 10  
!     modification by Choi &amp; Light, J. Chem. Phys., 97, 7031 (1992).
      sqrt2=sqrt(2.0)                       
      xmup1=sqrt2/3.0+0.5                   
      xmum1=xmup1-x1                        
      term=2.0*xmum1*xmup1*q1*q2*cos(theta) 
      r1=toang*sqrt((xmup1*q1)**2+(xmum1*q2)**2-term)                   
      r2=toang*sqrt((xmum1*q1)**2+(xmup1*q2)**2-term)                   
      rhh=sqrt(q1**2+q2**2-2.0*q1*q2*cos(theta))                        
      rbig=(r1+r2)/sqrt2                    
      rlit=(r1-r2)/sqrt2                    
                
                
      alpha=(x1-tanh(gammas*rbig**2))*(x1-tanh(gammaa*rlit**2))         
      alpha1=beta1*alpha                    
      alpha2=beta2*alpha                    
      drhh=toang*(rhh-delta*rhh0)           
      DOLEG=     (1.4500-THETA)             
!     IF (THETA.LE.0.64  ) V=0.1E17         
!     IF((DR.LE.-0.4).AND.(THETA.LE.1.1)) V=0.1E17                      
!     IF((DS.LE.-0.4).AND.(THETA.LE.1.1)) V=0.1E17                      
!     IF (DS.LE. 0.0  ) V=0.1E17            
      v = v + c1*exp(-alpha1*drhh) + c2*exp(-alpha2*drhh)               
   10 continue  
!     Convert to Hartree                    
      V=V/CMTOAU
!      write(53,*) Q1,Q2,THETA              
      RETURN    
      END       
                
                
      subroutine coortrans_12(a,b,c,d,rab,rac,rad,rbc,rbd,rcd,cosdi)    
      implicit real*8(a-h,o-z)              
      dimension a(3),b(3),c(3),d(3),v1v2(3),v2v3(3)                     
      dimension v1(3),v2(3),v3(3),vab(3),vac(3),vcd(3)                  
!               
      v1(1)=c(1)-b(1)                       
      v1(2)=c(2)-b(2)                       
      v1(3)=c(3)-b(3)                       
      rbc=sqrt(v1(1)**2+v1(2)**2+v1(3)**2)  
!               
      v2(1)=d(1)-b(1)                       
      v2(2)=d(2)-b(2)                       
      v2(3)=d(3)-b(3)                       
      rbd=sqrt(v2(1)**2+v2(2)**2+v2(3)**2)  
!               
      v3(1)=a(1)-d(1)                       
      v3(2)=a(2)-d(2)                       
      v3(3)=a(3)-d(3)                       
      rad=sqrt(v3(1)**2+v3(2)**2+v3(3)**2)  
!               
      vab(1)=b(1)-a(1)                      
      vab(2)=b(2)-a(2)                      
      vab(3)=b(3)-a(3)                      
      rab=sqrt(vab(1)**2+vab(2)**2+vab(3)**2)                           
!               
      vac(1)=c(1)-a(1)                      
      vac(2)=c(2)-a(2)                      
      vac(3)=c(3)-a(3)                      
      rac=sqrt(vac(1)**2+vac(2)**2+vac(3)**2)                           
!               
      vcd(1)=d(1)-c(1)                      
      vcd(2)=d(2)-c(2)                      
      vcd(3)=d(3)-c(3)                      
      rcd=sqrt(vcd(1)**2+vcd(2)**2+vcd(3)**2)                           
! v1v2=v1 X v2,  v2v3=v2 X v3               
      v1v2(1)=v1(2)*v2(3)-v1(3)*v2(2)       
      v1v2(2)=v1(3)*v2(1)-v1(1)*v2(3)       
      v1v2(3)=v1(1)*v2(2)-v1(2)*v2(1)       
!               
      v2v3(1)=v2(2)*v3(3)-v2(3)*v3(2)       
      v2v3(2)=v2(3)*v3(1)-v2(1)*v3(3)       
      v2v3(3)=v2(1)*v3(2)-v2(2)*v3(1)       
!               
      av1v2=sqrt(v1v2(1)**2+v1v2(2)**2+v1v2(3)**2)                      
      av2v3=sqrt(v2v3(1)**2+v2v3(2)**2+v2v3(3)**2)                      
      costh3=(v1(1)*v3(1)+v1(2)*v3(2)+v1(3)*v3(3))/(rbc*rad)            
! th1           
      costh1=(rbc**2+rbd**2-rcd**2)/(2.0*rbc*rbd)                       
      if(costh1.gt.1.0) costh1=1.0          
      if(costh1.lt.-1.0) costh1=-1.0        
      th1=acos(costh1)                      
      sinth1=sin(th1)                       
! th2           
      costh2=((rbd**2+rad**2-rab**2)/(2.0*rbd*rad))                     
      if(costh2.gt.1.0) costh2=1.0          
      if(costh2.lt.-1.0) costh2=-1.0        
      th2=acos(costh2)                      
      sinth2=sin(th2)                       
! get the dihedral angle                    
      if(abs(sinth1).le.1.d-5.or.abs(sinth2).le.1.d-5) then             
        cosdi=1.
      else      
        cosdi=-(v1v2(1)*v2v3(1)+v1v2(2)*v2v3(2)+v1v2(3)*v2v3(3)) &      
           /(av1v2*av2v3)                   
      endif     
      if(cosdi.gt.1.0) cosdi=1.0            
      if(cosdi.lt.-1.0) cosdi=-1.0          
      return    
      end       
      subroutine anim(y,a,b,c,d)            
      implicit double precision (a-h,o-z)   
      dimension y(18), rcm(3),a(3),b(3),c(3),d(3)                       
!  write out cartesian coordinates for atoms
      data ua,ub,uc,ud/1837.30,29165.00,1837.30,1837.30/                
      ucd=uc*ud/(uc+ud)                     
      ubcd=ub*(uc+ud)/(ub+uc+ud)            
      uabcd=ua*(ub+uc+ud)/(ua+ub+uc+ud)     
      temp=uabcd/(ub+uc+ucd)                
      do 10 i=1,3                           
      rcm(i)=temp*y(i)                      
 10   continue  
! a=H3, b=O,c=H2, d=H1                      
      a(1)=y(1)-rcm(1)                      
      a(2)=y(2)-rcm(2)                      
      a(3)=y(3)-rcm(3)                      
      temp=ubcd/ub                          
      b(1)=temp*y(4)-rcm(1)                 
      b(2)=temp*y(5)-rcm(2)                 
      b(3)=temp*y(6)-rcm(3)                 
      temp=ubcd/(uc+ud)                     
      temp1=ucd/uc                          
      c(1)=-temp*y(4)+temp1*y(7)-rcm(1)     
      c(2)=-temp*y(5)+temp1*y(8)-rcm(2)     
      c(3)=-temp*y(6)+temp1*y(9)-rcm(3)     
      temp1=ucd/ud                          
      d(1)=-temp*y(4)-temp1*y(7)-rcm(1)     
      d(2)=-temp*y(5)-temp1*y(8)-rcm(2)     
      d(3)=-temp*y(6)-temp1*y(9)-rcm(3)     
      end       
